// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.11;

/* import "./OwlCatContract.sol";
import "./OwlCatOwner.sol"; */
import "./IOwlCatMarketplace.sol";

contract OwlCatMarketPlace is OwlCatOwner, IOwlCatMarketPlace {
  OwlCatContract private _owlCatContract;

  struct Offer {
    address payable seller;
    uint256 price;
    uint256 index;
    uint256 tokenId;
    bool active;
  }

  Offer[] offers;

  mapping(uint256 => Offer) tokenIdToOffer;

  function setOwlCatContract(address _owlCatContractAddress) public onlyOwner {
    _owlCatContract = OwlCatContract(_owlCatContractAddress);
  }

  constructor(address _owlCatContractAddress) {
    setOwlCatContract(_owlCatContractAddress);
  }

  function getOffer(uint256 _tokenId) public view returns (
    address seller,
    uint256 price,
    uint256 index,
    uint256 tokenId,
    bool active
  ) {

    Offer storage offer = tokenIdToOffer[_tokenId];

    return(
      offer.seller,
      offer.price,
      offer.index,
      offer.tokenId,
      offer.active
    );
  }

  function getAllTokenOnSale() public view returns(uint256[] memory listOfOffers){

    uint256 totalOffers = offers.length;

    if(totalOffers == 0)
      return new uint256[](0);
    else{

      uint256[] memory result = new uint256[](totalOffers); // hack in OwlCatContract with constructor and for OwlCat 0
      uint256 offerId;

      for(offerId = 0; offerId < totalOffers; offerId++)
        if(offers[offerId].active == true)
          result[offerId] = offers[offerId].tokenId;

      return result;
    }
  }

  function _ownsOwlCat(address _address, uint256 _tokenId) internal view returns(bool){
    return(_owlCatContract.ownerOf(_tokenId) == _address);
  }

  function setOffer(uint256 _price, uint256 _tokenId) public {
    require(_ownsOwlCat(msg.sender, _tokenId), "You are not owner of that OwlCat");
    require(tokenIdToOffer[_tokenId].active == false, "You can't sell twice the same offrers");
    require(_owlCatContract.isApprovedForAll(msg.sender, address(this)), "Contract needs to be approved");

    // msg.sender and tx.origin are not type payable by default anymore so payable(msg.sender).transfer
    Offer memory _offer = Offer({
      seller: payable(msg.sender), 
      price: _price,
      active: true,
      tokenId: _tokenId,
      index: offers.length
    });

    tokenIdToOffer[_tokenId] = _offer;
    offers.push(_offer);

    emit MarketTransaction("Create offer", msg.sender, _tokenId);
  }

  function removeOffer(uint256 _tokenId) public {
    Offer memory offer = tokenIdToOffer[_tokenId];
    require(offer.seller == msg.sender, "You are not the seller of that OwlCat");

    delete tokenIdToOffer[_tokenId];
    offers[offer.index].active = false;

    emit MarketTransaction("Remove offer", msg.sender, _tokenId); 
  }

  function buyOwlCat(uint256 _tokenId) public payable {
    Offer memory offer = tokenIdToOffer[_tokenId];
    require(msg.value == offer.price, "The price is incorrect");
    require(offer.active == true, "No active order present");

    // Important: delete the OwlCat form the mapping before paying out to prevent reentry attcks
    delete tokenIdToOffer[_tokenId];
    offers[offer.index].active = false;

    // Transfer the funds to the seller
    //TODO: make this logic pull instead push
    if(offer.price > 0){
      offer.seller.transfer(offer.price);
    }

    //Transfer ownership of the OwlCat
    _owlCatContract.transferFrom(offer.seller, msg.sender, _tokenId);

    emit MarketTransaction("Buy", msg.sender, _tokenId);
  }
}
